Often, you will want to create a dynamic website. For this, you can create a file called main.[js,ts,jsx,tsx] in the folder. This file should export a default object with a fetch method that takes a Request object as argument, and returns a Response object. Here is an example of a simple HTTP server: // File: ~/www/demo/main.ts export default { fetch(request: Request) { const url = new URL(request.url); const name = url.searchParams.get("name") || "world"; return new Response(`Hello, ${name}!`, { headers: { "Content-Type": "text/plain", }, }); },
} Smallweb use the deno runtime to evaluate the server code. You get typescript and jsx support out of the box, and you can import any module from the npm and jsr registry by prefixing the module name with npm: or jsr:. As an example, the following code snippet use the @hono/hono extract params from the request url, and render jsx: // File: ~/www/hono/main.tsx
/** @jsxImportSource jsr:@hono/hono/jsx **/ import { Hono } from "@hono/hono"; const app = new Hono(); app.get("/", c => c.html(<h1>Hello, world!</h1>)); app.get("/:name", c => c.html(<h1>Hello, {c.req.param("name")}!</h1>)); export default app; No need to run an install command, or configure typescript. Just copy-paste the snippet at ~/www/hono/main.tsx, and open the corresponding url in your browser. You are not limited to serving html responses. Smallweb is perfect for creating APIs, or small services (ex: discord/telegram bots, webhooks, etc)...

