You can set environment variables for your app by creating a file called .env in the folder. Here is an example of a .env file: NAME=world You can access the environment variables in your app using the Deno.env object: // File: ~/www/demo/main.ts
export default function () { const name = Deno.env.get("NAME") || "world"; return new Response(`Hello, ${name}!`, { headers: { "Content-Type": "text/plain", }, });
}
